import React, { Component } from 'react';

class MomReviewer extends Component {
    render() {
        return (
            <div>
                업체에서 리뷰 해달라고 요청 들어 온 건
                내가 올린 리뷰들 리스트 보여준다.
            </div>
        );
    }
}

export default MomReviewer;
